const input = [
  "",
  "",
  "",
  "",
  "",
];

const codes = [
  ["", "", "1", "", ""],
  ["", "2", "3", "4", ""],
  ["5", "6", "7", "8", "9"],
  ["", "A", "B", "C", ""],
  ["", "", "D", "", ""],
];

for (var i of input) {
  var posX = 0, posY = 2;
  for (var c of i.split("")) {
    switch (c) {
      case "D":
        posY++;
        if (!codes[posY] || !codes[posY][posX]) posY--;
        break;
      case "U":
        posY--;
        if (!codes[posY] || !codes[posY][posX]) posY++;
        break;
      case "L":
        posX--;
        if (!codes[posY][posX]) posX++;
        break;
      case "R":
        posX++;
        if (!codes[posY][posX]) posX--;
        break;
    }
  }
  process.stdout.write(codes[posY][posX].toString());
}